class Lottery extends Component{


  renderButton (){

    return <button>Купи билет</button>
  }

  render(){

    return (

        <>
          <h2>Лотария</h2>
          {this.renderButton()}
          {this.props.remainingTickets}
        </>
   
      );

  }
  
}

export default Lottery;
